function Home() {
  return (
    <div
      style={{
        alignItems: "center",
        display: "flex",
        height: "100vh",
        justifyContent: "center"
      }}
    >
      <div
        style={{
          marginBottom: "40px",
          width: "320px"
        }}
      >
        <div
          style={{
            fontSize: "32px",
            fontWeight: "800",
            lineHeight: "35px",
            marginBottom: "20px"
          }}
        >
        </div>
      </div>
    </div>
  );
}

export default Home;
